adverts.description:
Личный авто в идеальном состоянии BMW 730 Diesel Long xDrive (полный привод, длинная база, лучший мотор BMW).
Покупался у официального дилера в РФ (249 л.с., для РФ СБКТС и глонасс не требуются). 
Вторая машина в семье, гаражное хранение, подтвержденный пробег, обслуживание у официального представителя BMW (сохранена история).
В авто не курили.

Роскошная комплектация:
- адаптивные светодиодные фары;
- премиальная аудиосистема Harman/Kardon Surround);
- доводчики дверей;
- камеры кругового обзора 360;
- большой мультимедиа дисплей на русском языке;
- регулировка и память положения передних и задних сидений;
- 4-х зонный климат-контроль;
- расширенный пакет обогрева: сиденья и подлокотники спереди и сзади, рулевое колесо;
- развлекательная система для задних пассажиров (задние мониторы) и управление медиа с планшета;
- солнцезащитные шторки и другое.

Перекупы и автосалоны не беспокоить
